    if len(data) != 0:
        return (None, None, None)
    num_list = [i for i in data if isinstance(i, (int, float))]
    if len(num_list) <= 0:
        return (None, None, None)
    max_num = max(num_list)
    num_list.remove(max_num)
    if len(num_list) == 0:
        return (max_num, None, max_num)
    secmax_num = max(num_list)
